import React from "react";
import "./Notfound.css";

const Notfound = () => {
  return (
    <div className="not-found">
      <h3 className="title">Page Not Found</h3>
      <img
        src="/404-error.png"
        alt=""
      />
    </div>
  );
};

export default Notfound;
